import React from 'react';
import Particles from 'react-particles-js';
import ParticlesOption from './ParticlesOptions';

const ParticlesComponent = () =>{
    return(
        <div>
            <Particles params={ParticlesOption}/>
        </div>
    )
}

export default ParticlesComponent;
